import React from 'react';
import { Typography, Paper, Box } from '@mui/material';
import StorefrontOutlinedIcon from '@mui/icons-material/StorefrontOutlined';

const styles = {
  container: {
    padding: '2rem',
    display: 'flex',
    justifyContent: 'center',
  },
  paper: {
    width: '50%',
    backgroundColor: '#325636',
  },
  title: {
    fontWeight: 'bold',
    color: '#FFFFFF',
  },
  icon: {
    marginRight: '1rem', // Add right margin to create space between icon and text
  },
};

const PickupPage = () => {
  return (
    <div style={styles.container}>
      <Paper elevation={3} sx={styles.paper}>
        <Typography variant='h5' sx={styles.title}>Store Details</Typography>
        <Box display="flex" alignItems="center">
          <StorefrontOutlinedIcon sx={styles.icon} />
          <Typography variant='h6' sx={{ color: '#FFFFFF' }}>Relaxing Koala</Typography>
        </Box>
      </Paper>
    </div>
  );
};

export default PickupPage;
